import React, { useState } from 'react';
import {Link} from "react-router-dom"
import s from "../css/nav.module.css"
import logo from "../../img/logo.png"
import crea from "../../img/manuscrito.png"
const Nav = () => {
const [search, setSearch] = useState();
    return ( 
    <div className={s.contenedorNav}>
        <nav className={s.nav}>
            <img className={s.logo} src={logo}></img>
            <form className={s.form}>
                <input className={s.buscador} placeholder="Buscar Pokemon.." value={search}  />
                <button className={s.submit} type="submit"> Buscar</button>
            </form>
            <div>
                < Link className={s.linkCrear} to={"/create"}><img src={crea}></img> Crea tu Pokemon!</Link>
            </div>
        </nav>
    </div>
    );
}
 
export default Nav;
